import React from 'react';
import { Card, Image } from 'react-bootstrap';

function CurrentWeather(props) {

  console.log(props.weather)
  // const { weather } = props.weather;

  if (!props.weather) {
    return 'Loading...'
  }

  return (
    <Card>
        <Card.Body>
          <React.Fragment>
          <Image src={`https://openweathermap.org/img/wn/${props.weather.weather[0].icon}@3x.png`} />
            <div>
              <i className={`owf owf-${props.weather.weather[0].id} owf-5x`}></i>
            </div>
            <div>{ props.weather.weather[0].main} </div>
            <div>{ props.weather.weather[0].description} </div>
          </React.Fragment>
        </Card.Body>
    </Card>
  );
}

export default CurrentWeather;
